import React, { Component } from "react";
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import "./style.css";

class App extends Component {
  constructor(props) {
    super(props)
    const token = localStorage.getItem('user-jwt');
    this.state = {
       isLoggedIn: false || token
    }
  }

  render() {
    return (
    <div className='app'>
      <header>
        <h1>Give Back NYC</h1>
        <h2>to your community</h2>
      </header>
      {this.isLoggedIn && (
        <form>
          <label>Search volunteering opportunities by zipcode: 
            <input type="text" placeholder="Enter Zipcode" onChange={this.handleChange}/>
          </label>
        </form>
      )}
    </div>
    )
  }
}

export default App;
